// filepath: /c:/Users/Skyla/Desktop/Portfolio/portfolio-website/my-react-app/src/pages/Home.js
import React from 'react';

function Home() {
  return (
    <div>
      <header className="home-header">
        <h1>Welcome to My Portfolio!</h1>
        <p>Discover my projects and get to know more about me.</p>
      </header>
      <main className="home-content">
        <section>
            <h2>About Me</h2>
            <p>Brief introduction about yourself.</p>
            <h2>Featured Projects</h2>
            <p>Highlight some of your key projects.</p>
        </section>
      </main>
    </div>
  );
}

export default Home;
